import React from 'react';
import TeamMember from './TeamMember';;

function Team(){
    return(
        <div className="row">
        <TeamMember
        info={
            {
                img: 'https://picsum.photos/200',
                name: 'Maha Alsuhaymi',
                position: 'Programmer',
                phone: '+49 12345678',
                email: 'maha@team.com',
                website: 'mahaAlsuhaymi.com',
            }
        }
        />

        <TeamMember
        info={
            {
                img: 'https://picsum.photos/201',
                name: 'Sara Ali',
                position: 'Designer',
                phone: '+49 34597278',
                email: 'sara@team.com',
                website: 'saraAli.com',
            }
        }
        />

        <TeamMember
        info={
            {
                img: 'https://picsum.photos/203',
                name: 'Alaa Salem',
                position: 'Designer',
                phone: '+49 47435678',
                email: 'Alaa@team.com',
                website: 'AlaaSalem.com',
            }
        }
        />

        <TeamMember
        info={
            {
                img: 'https://picsum.photos/204',
                name: 'Dana Ahm',
                position: 'Programmer',
                phone: '+49 34594478',
                email: 'DanaMo@team.com',
                website: 'DanaMoh.com',
            }
        }
        />
        </div>
    );
}

export default Team
